import sympy as sp

def fibonacci(n):
    if n <= 0:
        return "输入错误"
    elif n == 1:
        return 0
    else:
        a, b = 0, 1
        for _ in range(2, n + 1):
            a, b = b, a + b
        return b

# 使用斐波那契数列的第10项
print(fibonacci(10))

